import React from "react";
import { Map, Marker, Popup, TileLayer } from "react-leaflet";
import { Icon } from "leaflet";
import * as parkData from "./data/skateboard-parks.json";
import "./App.css";
import useSwr from "swr";

const fetcher = (...args) => fetch(...args).then(response => response.json());


export const icon = new Icon({
  iconUrl: "/skateboarding.svg",
  iconSize: [25, 25]
});

export default function App() {
  const url =
  'https://www.mountainproject.com/data/get-routes-for-lat-lon?lat=40.65&lon=-111.91&maxDistance=10&minDiff=5.6&maxDiff=5.10&key=200703063-2c86cd159070d7b2b2f9abc830c4f44b';
  const { data, error } = useSwr(url, { fetcher });
  const fires = data && !error ? data : [];
  return (
    <Map center={[40.65, -111.91]} zoom={12}>
      <TileLayer
        url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
      />

      {fires.map(fire => (
        <Marker
          key={fire.id}
          position={[fire['point']['coordinates'][1], fire['point']['coordinates'][0]]}
        />
      ))}
    </Map>
  );
}
